import React from 'react';
import DeliveryProcedure from './DeliveryProcedure';

const Procedure = DeliveryProcedure.map(item => {
    return (<><div className="col-4 d-flex flex-column align-items-center py-1">
        <i className={item.icon}></i>
        <p className="text-muted text-center">{item.text}</p>
    </div></>);
})

const DeliveryLower = () => {
    return (<>
        <div id="Lower">
            <h5 className="text-center py-2">Do more with gold</h5>
            <div className="row">
                <div className="col-11 mx-auto">
                    <div className="row">
                        {Procedure}
                    </div>
                </div>
            </div>
        </div>
    </>)
}

export default DeliveryLower;
